import { Routes, Route } from 'react-router-dom';

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>Contact</h2>;
}

function App() {
  return (
    <div>
      <h1>Hello React Router v6</h1>
      <Home />
      <About />
      <Contact />
    </div>
  );
}

export default App;
